import React, { Component } from 'react';
import FadeIn from 'react-fade-in';

class Projects extends Component {
    render() {
        return (
            <div className="container">
                <FadeIn transitionDuration="1000"><h1>Projects</h1></FadeIn>
            </div>
        )
    }
}

export default Projects;
